import React from "react";
import "./Home.css";
import Product from "./Product";
function Home() {
  return (
    <div className="home">
      <img
        className="home__image"
        src="https://www.projectblitz.com/pub/media/myupload/chunky_dunky_blitz_banner_1.jpg"
        alt=""
      />

      {/* Product id, title, price, rating, image */}
      <div className="home__row">
        <Product
          id="1"
          title="Nike SB x Ben & Jerry’s Dunk Low 'Chunky Dunky' (2020)"
          price="999.99"
          rating={4}
          image="https://cdn.filestackcontent.com/CyHCUoLvSTc5NJ4qCkuT"
        />
      </div>

      <div className="home__row">
        <Product
          id="1"
          title="Nike SB x Ben & Jerry’s Dunk Low 'Chunky Dunky' (2020)"
          price="999.99"
          rating={4}
          image="https://cdn.filestackcontent.com/CyHCUoLvSTc5NJ4qCkuT"
        />
      </div>

      <div className="home__row">
        <Product
          id="1"
          title="Nike SB x Ben & Jerry’s Dunk Low 'Chunky Dunky' (2020)"
          price="999.99"
          rating={4}
          image="https://cdn.filestackcontent.com/CyHCUoLvSTc5NJ4qCkuT"
        />
      </div>
    </div>
  );
}

export default Home;
